// HeroWithAnimation.jsx

import React, { useEffect } from "react";
import { motion, useAnimation } from "framer-motion";

const textVariant = {
  hidden: { opacity: 0, y: 30 },
  visible: (delay = 0) => ({
    opacity: 1,
    y: 0,
    transition: { delay, duration: 0.8, ease: "easeOut" }
  })
};

const logoVariant = {
  hidden: { opacity: 0, scale: 0.8 },
  visible: (i = 1) => ({
    opacity: 1,
    scale: 1,
    transition: { delay: i * 0.2, duration: 0.7, ease: "easeOut" }
  })
};

export default function HeroWithAnimation() {
  const controls = useAnimation();

  useEffect(() => {
    // trigger all animations on mount
    controls.start("visible");
  }, [controls]);

  const logos = [
    // replace with your logo URLs
    "https://upload.wikimedia.org/wikipedia/commons/8/8d/FAB_Bank_Logo.svg",
    "https://upload.wikimedia.org/wikipedia/commons/8/8a/KPIT_Technologies_Logo.svg",
    "https://upload.wikimedia.org/wikipedia/commons/8/8e/Tata_logo.svg",
    "https://upload.wikimedia.org/wikipedia/commons/5/52/Sony_logo.svg",
    "https://1000logos.net/wp-content/uploads/2021/11/Huggies-logo.png",
    "https://eton-solutions.com/wp-content/uploads/2023/02/eton-solutions-logo.svg",
    "https://upload.wikimedia.org/wikipedia/commons/f/fd/Star_Plus_2010_logo.png",
    "https://upload.wikimedia.org/wikipedia/commons/9/99/Procter_%26_Gamble_logo.svg"
  ];

  return (
    <div className="relative w-full min-h-screen bg-white overflow-hidden">
      {/* Navbar */}
      <header className="flex justify-between items-center px-10 py-6 relative z-10">
        <motion.div
          initial="hidden"
          animate={controls}
          variants={textVariant}
          custom={0.1}
          className="flex items-center gap-2 text-2xl font-bold"
        >
          <img
            src="https://leo9studio.com/favicon.ico"
            alt="logo"
            className="w-8 h-8"
          />
          <span>leo9</span>
        </motion.div>
        <motion.nav
          initial="hidden"
          animate={controls}
          variants={textVariant}
          custom={0.2}
          className="flex gap-8 font-medium"
        >
          <a href="#">Work</a>
          <a href="#">Services</a>
          <a href="#">Clients</a>
          <a href="#">About</a>
          <a href="#">Knowledge</a>
        </motion.nav>
        <motion.button
          initial="hidden"
          animate={controls}
          variants={textVariant}
          custom={0.3}
          className="bg-black text-white px-4 py-2 rounded-md"
        >
          Contact
        </motion.button>
      </header>

      {/* Hero Text */}
      <section className="flex flex-col justify-center items-center text-center mt-20 px-6 relative z-10">
        <motion.p
          initial="hidden"
          animate={controls}
          variants={textVariant}
          custom={0.4}
          className="text-sm text-gray-600 mb-2"
        >
          Your Trusted UI UX Design Agency.
        </motion.p>

        <motion.h1
          initial="hidden"
          animate={controls}
          variants={textVariant}
          custom={0.6}
          className="text-6xl font-extrabold leading-tight"
        >
          Design <br />
          Transform <br />
          Accelerate
        </motion.h1>

        <motion.p
          initial="hidden"
          animate={controls}
          variants={textVariant}
          custom={0.8}
          className="text-lg text-gray-700 mt-4"
        >
          Redefining user experiences through <br />
          <span className="font-semibold">Behavioural Science & AI</span>
        </motion.p>
      </section>

      {/* Logos Reveal */}
      <section className="mt-16 grid grid-cols-4 md:grid-cols-8 gap-8 px-10 pb-20 relative z-10">
        {logos.map((logo, i) => (
          <motion.div
            key={i}
            initial="hidden"
            animate={controls}
            variants={logoVariant}
            custom={i + 1}
            className="flex justify-center items-center"
          >
            <img src={logo} alt={`client-${i}`} className="h-8 object-contain" />
          </motion.div>
        ))}
      </section>
    </div>
  );
}
